        [FunctionName("Recognize")]
        public static async Task<HttpResponseMessage> Run([HttpTrigger(AuthorizationLevel.Function, "get", "post", Route = null)]HttpRequestMessage req, TraceWriter log, Microsoft.Azure.WebJobs.ExecutionContext context)
        {
            log.Info("C# HTTP trigger function processed a request.");
            try
            {
                idolPersons = JsonConvert.DeserializeObject<List<ReceivedPerson>>(json);
            }
            catch(Exception e)
            {
                req.CreateResponse(HttpStatusCode.InternalServerError, e.Message + "\n" + e.StackTrace);
            }

            // parse query parameter
            string url = req.GetQueryNameValuePairs()
                .FirstOrDefault(q => string.Compare(q.Key, "url", true) == 0)
                .Value;

            dynamic data = await req.Content.ReadAsAsync<object>();

            // Set name to query string or body data
            url = url ?? data?.url;

            if (url == null)
            {
                return req.CreateResponse(HttpStatusCode.BadRequest, "Please enter the correct url"); 
            }
            else
            {
                try
                {
                    List<ReturnedIdol> result = Recognize(url);
                    var json = JsonConvert.SerializeObject(result);
                    return new HttpResponseMessage(HttpStatusCode.OK) {
                        Content = new StringContent(json, Encoding.UTF8, "application/json")
                    }; 
                }
                catch(Exception e)
                {
                    return req.CreateErrorResponse(HttpStatusCode.InternalServerError, e.Message + "\n" + e.StackTrace);
                }
            }
        }

        static List<ReturnedIdol> Recognize(String imageUrl)
        {
            Console.WriteLine("Begin to recognize image: " + imageUrl);
            List<DetectedFace> detectedFaces = Detect(imageUrl);

            if (detectedFaces.Count == 0)
            {
                Console.WriteLine("Can't detect any face");
            }

            // compare these detected faces with face in group
            List<IdentifiedFace> identifiedFaces = Identify(detectedFaces.Select(x => x.faceId).ToList());
            List<ReturnedIdol> allIdols = identifiedFaces.Aggregate(new List<ReturnedIdol>(),
                                                                    (list, iface) =>
                                                                    {
                                                                        ReturnedIdol returnedIdol = new ReturnedIdol();
                                                                        returnedIdol.face = detectedFaces.Where(df => df.faceId == iface.faceId).First().faceRectangle;
                                                                        if (iface.candidates.Count > 0)
                                                                        {
                                                                            String idolId = iface.candidates[0].personId;
                                                                            ReceivedPerson idol = idolPersons.Where(p => p.personId == idolId).FirstOrDefault();
                                                                            returnedIdol.id = idol.userData;
                                                                            returnedIdol.name = idol.name;
                                                                        }
                                                                        else
                                                                        {
                                                                            returnedIdol.id = 0;
                                                                            returnedIdol.name = "Unknown";
                                                                        }
                                                                        list.Add(returnedIdol);
                                                                        return list;
                                                                    });
            return allIdols;
        }

        static List<IdentifiedFace> Identify(List<String> faceIds)
        {
            Console.WriteLine("Begin to identify face");
            var client = new HttpClient();
            client.DefaultRequestHeaders.Add("Ocp-Apim-Subscription-Key", "d2f305860c3447d585a8f288827d24b2");
            var uri = "https://westeurope.api.cognitive.microsoft.com/face/v1.0/identify";

            HttpResponseMessage response;

            object data = new
            {
                faceIds = faceIds.ToArray(),
                personGroupId = "vav-idols",
                maxNumOfCandidatesReturned = 1
            };

            var content = JsonConvert.SerializeObject(data);
            byte[] byteData = Encoding.UTF8.GetBytes(content);
            using (var byteContent = new ByteArrayContent(byteData))
            {
                byteContent.Headers.ContentType = new MediaTypeHeaderValue("application/json");
                response = client.PostAsync(uri, byteContent).Result;
                if (response.IsSuccessStatusCode)
                {
                    return JsonConvert.DeserializeObject<List<IdentifiedFace>>(response.Content.ReadAsStringAsync().Result);
                }
            }
            return null;
        }

        static List<DetectedFace> Detect(String imageUrl)
        {
            Console.WriteLine(String.Format("Begin to detect face from image: {0}", imageUrl));

            var client = new HttpClient();
            client.DefaultRequestHeaders.Add("Ocp-Apim-Subscription-Key", "d2f305860c3447d585a8f288827d24b2");
            var uri = "https://westeurope.api.cognitive.microsoft.com/face/v1.0/detect";

            HttpResponseMessage response;

            object data = new
            {
                url = imageUrl
            };

            var content = JsonConvert.SerializeObject(data);
            byte[] byteData = Encoding.UTF8.GetBytes(content);
            using (var byteContent = new ByteArrayContent(byteData))
            {
                byteContent.Headers.ContentType = new MediaTypeHeaderValue("application/json");
                response = client.PostAsync(uri, byteContent).Result;
                if (response.IsSuccessStatusCode)
                {
                    return JsonConvert.DeserializeObject<List<DetectedFace>>(response.Content.ReadAsStringAsync().Result);
                }
            }
            return null;
        }
        static void SubmitIdolFace(String personId, String faceUrl)
        {
            Console.WriteLine(String.Format("Begin submit image {0} for person id {1}", faceUrl, personId));

            var client = new HttpClient();

            // Request headers
            client.DefaultRequestHeaders.Add("Ocp-Apim-Subscription-Key", "d2f305860c3447d585a8f288827d24b2");
            var uri = "https://westeurope.api.cognitive.microsoft.com/face/v1.0/persongroups/vav-idols/persons/" + personId + "/persistedFaces";

            HttpResponseMessage response;

            object data = new
            {
                url = faceUrl
            };

            // serialize object to json
            var content = JsonConvert.SerializeObject(data);
            // request body 
            byte[] byteData = Encoding.UTF8.GetBytes(content);

            using (var byteContent = new ByteArrayContent(byteData))
            {
                byteContent.Headers.ContentType = new MediaTypeHeaderValue("application/json");
                response = client.PostAsync(uri, byteContent).Result;
                if (response.IsSuccessStatusCode)
                {
                    Console.WriteLine("SUCCESS - Submit image " + faceUrl);
                }
            }
        }
        static void SubmitIdol(Idol idol)
        {
            Console.WriteLine("Start submitting idol " + idol.name);
            var client = new HttpClient();

            // Request headers
            client.DefaultRequestHeaders.Add("Ocp-Apim-Subscription-Key", "d2f305860c3447d585a8f288827d24b2");

            var uri = "https://westeurope.api.cognitive.microsoft.com/face/v1.0/persongroups/vav-idols/persons";

            HttpResponseMessage response;

            // serialze object to json 
            object data = new
            {
                name = idol.name,
                userData = idol.index
            };
            var content = JsonConvert.SerializeObject(data);
            // Request body
            byte[] byteData = Encoding.UTF8.GetBytes(content);

            using (var byteContent = new ByteArrayContent(byteData))
            {
                byteContent.Headers.ContentType = new MediaTypeHeaderValue("application/json");
                response = client.PostAsync(uri, byteContent).Result;

                if (response.IsSuccessStatusCode)
                {
                    var person = JsonConvert.DeserializeObject<Person>(response.Content.ReadAsStringAsync().Result);
                    Console.WriteLine(String.Format("SUCCESS - Submit idol {0} - {1}. Person ID: {2}", idol.name, idol.index, person.personId));

                    for (var i = 0; i < idol.images.Count; i++)
                    {
                        try
                        {
                            SubmitIdolFace(person.personId, idol.images[i].image);
                            Thread.Sleep(4 * 1000);
                        }
                        catch (Exception e)
                        {
                            Console.WriteLine(e.Message);
                        }
                    }
                }
            }

        }

